import React from 'react';
import './App.css';
import backgroundImage from './assets/background.jpg';
import overlayImage from './assets/robot.png';
import Home from "./components/Home";
import About from "./components/Login";
import Blogs from "./components/Projects";


function App() {
  return (
    <div className="App">
      <header>
        <h1>Welcome to HopeKCC</h1>
      </header>
      <nav>
          <Link to="/">Home</Link>
          <Link to="/about">About</Link>
          <Link to="/services">Services</Link>
          <Link to="/contact">Contact</Link>
        </nav>
      <main style={{ backgroundImage: `url(${backgroundImage})` }}>
      <img src={overlayImage} alt="Overlay" className="overlay-image" />
      </main>
      <footer>
        <p>&copy; 2024 HopeKCC</p>
      </footer>
    </div>
  );
}

export default App;
